<p><a rel="nofollow" href="https://youtu.be/FEVx427j3H8">https://youtu.be/FEVx427j3H8</a></p>
&nbsp;
<p>All Vylon <a title="Equip Spell Card" rel="nofollow" href="https://yugipedia.com/wiki/Equip_Spell_Card">Equip Spell Cards</a> can only be equipped to a Vylon Monster and have a secondary effect that allows the player to search for another Vylon <a title="Spell Card" rel="nofollow" href="https://yugipedia.com/wiki/Spell_Card">Spell Card</a> when they are sent from the field to the graveyard while face up. This is perhaps their greatest asset, as it allows Vylon decks to keep their card advantage from their Spells as long as there are other Vylon Spells in the deck.</p>
<p>In <i><a title="Duel Terminal - Judgment of Omega!!" rel="nofollow" href="https://yugipedia.com/wiki/Duel_Terminal_-_Judgment_of_Omega!!">Duel Terminal - Judgment of Omega!!</a></i>, four Vylon Tuner monsters (levels 1 through 4) were introduced that have the ability to be <a title="Treated as Equip Card" rel="nofollow" href="https://yugipedia.com/wiki/Treated_as_Equip_Card">Treated as Equip Cards</a> when sent from the Monster Card Zone to the Graveyard (even when used for a <a title="Synchro Summon" rel="nofollow" href="https://yugipedia.com/wiki/Synchro_Summon">Synchro Summon</a>) at the cost of 500 <a class="mw-redirect" title="Life Points" rel="nofollow" href="https://yugipedia.com/wiki/Life_Points">Life Points</a>, each providing different effects when they are equipped. In <i><a title="Duel Terminal - Xyz Startup!!" rel="nofollow" href="https://yugipedia.com/wiki/Duel_Terminal_-_Xyz_Startup!!">Duel Terminal - Xyz Startup!!</a></i>, the Vylons obtained two <a class="mw-redirect" title="Union Monster" rel="nofollow" href="https://yugipedia.com/wiki/Union_Monster">Union Monsters</a> that can be equipped to another Vylon to grant effects when the equipped monster destroys another monster in battle, as well as one of the first <a title="Duel Terminal" rel="nofollow" href="https://yugipedia.com/wiki/Duel_Terminal">Duel Terminal</a>-exclusive <a title="Xyz Monster" rel="nofollow" href="https://yugipedia.com/wiki/Xyz_Monster">Xyz Monsters</a>, "<a title="Vylon Disigma" rel="nofollow" href="https://yugipedia.com/wiki/Vylon_Disigma">Vylon Disigma</a>".</p>
The Vylon strategy revolves around the use of <a title="Equip Card" rel="nofollow" href="https://yugipedia.com/wiki/Equip_Card">Equip Cards</a>, their effects often only working when they have at least one equipped. Their Equip Spell Cards can search out other Vylon Spells from the deck when they are sent to the Graveyard from the field, and most of their Tuner and Union monsters (except "<a title="Vylon Cube" rel="nofollow" href="https://yugipedia.com/wiki/Vylon_Cube">Vylon Cube</a>") can become Equip Cards. Their Equip Spells activate even when the monsters they are equipped to are destroyed or used as <a title="Synchro Material" rel="nofollow" href="https://yugipedia.com/wiki/Synchro_Material">Synchro Material</a>, letting their users gather the right tools for the situation at hand at any time, though they should always be aware of the number of Spell and Trap Card Zones they have left to work with. One should try to keep at least 1 Spell or Trap Card Zone open so that they can respond should the duel's situation suddenly change.

https://youtube.com/watch?v=ZKiTRNhQm0E - Top 16 Lists from the LCS

This is a <em>really</em> interesting list that topped the recent LCS and I think everyone should give it a look. :D

&nbsp;

Pure Lair of Darkness.

&nbsp;

Use Ahrima to to search Lord of the Heavenly Prison.

&nbsp;

Not playing Darkest Diabolos, it bricks too much early game.

This deck had real potential.

Full combo endboard.

DPE, baroness, savage or crystal wing, scythe and abyss dweller.
<p>This board would beat the majority meta decks slightly fragile at the start of play so if your opponent does not draw any hand traps or you draw into adamancipator cards or prank-kids Rockies and exceed. There is about a 70 percent chance you will still manage a full combo or a 90% chance you will have an end board of DPE, Savage and scythe. which is still a pretty decent board</p>
Going first can play through up to 3 hand traps and nib.

